import React from "react";
import { Navbar, NavbarBrand } from "react-bootstrap";
import Logo from "../../assets/whitetransparent.png";
const NavBar = () => {
  return (
    <Navbar>
      <NavbarBrand source={Logo} width={150} height={150} />
    </Navbar>
  );
};

export default NavBar;
